import React from 'react'
import './styles/index.css';
import Header from './components/Header.js'
import CreateNew from './components/CreateNew.js'
import TodoList from './components/TodoList.js'


function App() {
  return (
    <div class="app">
      <Header />
      <CreateNew />
      <TodoList />
    </div>
  )
}

export default App
